import React from 'react';
import './style.css';
import { Button } from 'react-bootstrap';
import { Nav, Navbar, NavItem } from 'react-bootstrap';

function Profile() {
  return (
    <header>
      <nav class="navbar navbar-default fixed-top navbar-light bg-light">
        <div class="container-fluid">
          <a class="navbar-brand" href="/main">Meetup</a>
          <div class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarCollapse">
            <span class="navbar-toggler-icon"></span>
          </div>
          <div class="collapse navbar-collapse" id="navbarCollapse">
            <ul class="navbar-nav ml-auto">
              <li class="nav-item ml-auto">
                <a class="nav-link" href="/profile">Profile</a>
              </li>
              <li class="nav-item ml-auto">
                <a class="nav-link" href="/createGroup">Create a group</a>
              </li>
              <li class="nav-item ml-auto">
                <a class="nav-link" href="#">Log out</a>
              </li>
            </ul>
          </div>
        </div>
      </nav>
    </header>
  );
}

export default Profile;
